description.text:
Basically just print dog.stl, clean up if needed, push fit on head and legs to body.
dog.scad is modular, lines at top:<br />
dog();<br />
//half_dog();<br />
//flegconn();<br />
//blegconn();<br />
//head();<br />
//body();<br />
//fleg();<br />
//bleg();<br />
//print();
dog() allows compiling whole assembled dog.<br />
print() allows compiling and render for export to dog.stl.<br />
whole dog can be scaled with scl variable, head can be seperately scaled with hdScl.
